  false,\n\t\"url\": null,\n\t\"notes\": \"This part of DS 781 presents data for the
  bathymetric contours for several seafloor maps of the Offshore of Fort Ross map
  area, California. The vector data file is included in \"Contours_OffshoreFortRoss.zip,\"
  which is accessible from http://pubs.usgs.gov/ds/781/OffshoreFortRoss/data_catalog_OffshoreFortRoss.html.
  10-m interval contours of the Offshore of Fort Ross map area, California, were generated
  from bathymetry data collected by California State University, Monterey Bay (CSUMB)
  and by Fugro Pelagos. Mapping was completed between 2007 and 2010, using a combination
  of 200-kHz and 400-kHz Reson 7125, and 244-kHz Reson 8101 multibeam echosounders,
  as well as 468-kHz SEA SWATHPlus interferometric system. These mapping missions
  combined to collect bathymetry from about the 10-m isobath to beyond the 3-nautical-mile
  limit of California State Waters. Bathymetric contours at 10-m intervals were generated
  from a bathymetric surface model. The most continuous contour segments were preserved
  while smaller segments and isolated island polygons were excluded from the final
  output. Contours were smoothed via a polynomial approximation with exponential kernel
  (PAEK) algorithm using a tolerance value of 60 m. The contours were then clipped
  to the boundary of the map area. These data are not intended for navigational purposes.\",\n\t\"owner_org\":
